import NavBar from 'NavBar';
export default function Top() {
    return( 
    <>       
     <div className='top'>
        <div>    
        <img className='imgnav' src='latiendita.jpg' alt=""></img>
        </div>

        <div>
            <span className='marcanav' >La Tiendita AJN</span>
            <NavBar />
        </div>   
    </div>
    </>
    )
}
